import './App.css';
import cocktails from './components/data.js';


  export default function RecipeList() {
    return (
      <div>
        <h1>Recipes</h1>
        {cocktails.map(cocktail =>
          <div key={cocktail.id}>
            <h2>{cocktail.name}</h2>
            <ul>
              {cocktails.ingredients.map(ingredient =>
                <li key={ingredient}>
                  {ingredient}
                </li>
              )}
            </ul>
          </div>
        )}
      </div>
    );
  };
